import React, { FC } from 'react';
import styles from './EmployeeItem.module.scss';
import Employee from '../../../../../models/Employee';

interface EmployeeItemProps {
  employee: Employee;
}

const EmployeeItem: FC<EmployeeItemProps> = ({employee}) => (

<div className={styles.EmployeeItem__empCard}>
  <header className={styles.EmployeeItem__empHeader}>
    מספר עובד: {employee.id}
  </header>
  <ul className={styles.EmployeeItem__empBody}>
    <li>שם פרטי: {employee.firstName}</li>
    <li>שם משפחה: {employee.lastName}</li>
    <li>תפקיד: {employee.title}</li>
    <li> מגורים: {employee.city}, {employee.country}</li>
    <li>תאריך לידה: {employee.birthDate}</li>
  </ul>
</div>

);

export default EmployeeItem;


